     function changeMode(thisSelect){
		var href = window.location.href.split('?')[0];
		new_href = href.replace(/\/(\w+)-(\d+)-(\d+)-(\d+)-(\w+).html$/, '\/$1-$2-'+thisSelect.value+'-$4-$5.html');
		//window.location.href=href+"?order="+thisSelect.value+'&page=1';
		alert(new_href);
		window.location.href = new_href;
	}

	function changePage(thisSelect){
		var href = window.location.href.split('?')[0];
		new_href = href.replace(/\/(\w+)-(\d+)-(\d+)-(\d+)-(\w+).html$/, '\/$1-$2-$3-'+thisSelect.value+'-$5.html');		
		window.location.href = new_href;
	}
