            function Navbezel()
            {
                var $navli = $("#nav").find("li");
                var $bezel;
                $navli.hover(function ()
                {
                    $bezel = $(this).find(".bezel");
                    if ($bezel.is(":hidden"))
                    {
                        if (!$bezel.is("animated"))
                        {
                            $bezel.show();
                        }
                    }
                }, function ()
                {
                    $bezel.hide();
                });
            }

            $(".vessel-one-set").mouseenter(function ()
            {
                var $parent = $(this);
                var index = $(this).index() - 1;
                var $twoset = $(this).find(".vessel-two");
                //console.log($twoset)
                if (index < 0)
                {
                    return false;
                }
                if ($twoset.is(":hidden"))
                {
                    //  console.log($twoset)
                    $twoset.show();
                    $(this).addClass('vessel-one-cur').siblings().removeClass('vessel-one-cur');
                }
            }).mouseleave(function (event)
            {
                var $parent = $(this);
                var index = $(this).index() - 1;
                var $twoset = $(this).find(".vessel-two");
                $twoset.hide();
                $(this).removeClass('vessel-one-cur')
            });
