            $.fn.extend({
                navslide: function (option)
                {

                    var def = {
                        parent: "",
                        nextbtn: ".nextbtn",
                        lastbtn: ".lastbtn",
                        ul: "",
                        vis: 10, //显示个数
                        speed: 36, //每一次运动的距离
                        area: 0,//已经运动了多步的步数
                        delayTime: 200 //效果速度
                    }
                    var _this = this;
                    var option = $.extend(def, {}, option);

                    option.parent = $(this).closest(option.parent).length > 0 ? $(this).closest(option.parent) : $(this);
                    $(this).each(function (i, elem)
                    {

                        var children = $(elem).find(option.ul).children();
                        var childrenzero = children.eq(0);

                        var length = children.length;
                        var height = childrenzero.height();//获得第一个的高度
                        var $nextbtn = $(elem).find(option.nextbtn);
                        var $lastbtn = $(elem).find(option.lastbtn);

                        if (height == 0)
                        {
//                            console.log($(option.parent))
                            $(option.parent).css("visibility", "hidden").show();
                            height = childrenzero.height();
                            $(option.parent).css("visibility", "visible").hide();
                        }
                        var difference = length - option.vis; //获得有多少个是需要显示的
                        //console.log("differencedifference",difference)
                        if (length > option.vis)
                        {

                            var arry = [$nextbtn, $lastbtn];
                            var nextint = null;
                            var lastint = null;

                            var oush = childrenzero.find('a').length > 0 ? childrenzero.find('a') : childrenzero;
                            var sepyd = $(elem).find('.vessel-two-title').length > 0 ? $(elem).find('.vessel-two-title') : $(elem).find('.vessel-fourlist').find('a');
                            $nextbtn.mouseenter(function (event)
                            {

                                var top = parseInt(oush.css("top").split("p")[0]);
                                nextint = setInterval(function ()
                                {
                                    if (top < 0)
                                    {
                                        option.area = option.area + option.speed;
                                        if (option.area > 0)
                                        {
                                            option.area = 0;
                                            window.clearInterval(nextint);
                                        }
                                        sepyd.animate({
                                            top: option.area
                                        }, option.delayTime);
                                    }
                                }, option.delayTime)
                            }).mouseleave(function ()
                            {
                                window.clearInterval(nextint);
                            });

                            $lastbtn.mouseenter(function (event)
                            {
                                var top = parseInt(oush.css("top").split("p")[0]);
                                var dolly = difference * childrenzero.height(); //获得可以移动的距离
                                lastint = setInterval(function ()
                                {
                                    if (top > -dolly)
                                    {
                                        option.area = option.area - option.speed;
                                        //console.log(option.area)
                                        if (-option.area > dolly)
                                        {
                                            option.area = -dolly;
                                            window.clearInterval(lastint);
                                        }
                                        sepyd.animate({
                                            top: option.area
                                        }, option.delayTime);

                                    }
                                }, option.delayTime)

                            }).mouseleave(function ()
                            {
                                console.log("离开时间", lastint)
                                window.clearInterval(lastint);
                            });
                        }
                        else
                        {
                            $nextbtn.remove();
                            $lastbtn.remove();
                        }
                        //console.log("-------------------------------------------")
                    });

                    //   $(".vessel-two ").eq(0).show();
                }
            });


