        var showTc = function(setting){
            this.url = setting.url;
            this.newbox = null;
            this.init();

        };
        showTc.prototype.init = function(){
            var _this = this;
            this.loadImage(function(){
                var ch = _this.creatHtml();
                var showTcboxImg = ch.find('.showTcbox-img');


                showTcboxImg.length > 0 && $(this).appendTo(showTcboxImg).addClass('showtcbox-enimg');

                showTcboxImg.css({
                    position: 'absolute',
                    top:100,
                    left: "50%",
                    marginLeft: - this.width / 2
                });


            });
        }
        showTc.prototype.showTcboxClose = function(){

            if(!!this.newbox){
                this.newbox.remove();
                $("html").css({
                    overflow  : "visible"
                })
            }
        }
        showTc.prototype.loadImage = function(callback){
            var img = new Image();
            img.src = this.url;
            if(img.complete) {
                console.log("获取缓存图片")
                callback.call(img);
                return;
            }
            img.onload = function () {
                console.log("加载新突")
                callback.call(img);
            };
        }
        showTc.prototype.creatHtml = function(){
            var _this = this;
            var newbox = "\

\

\

\
              \
              ";
            var $newbox = $(newbox).appendTo("body");

            $('html').css({
                overflow:"hidden"
            });

            $newbox.css({
                position: 'absolute',
                top:$(window).scrollTop(),
                left: 0,
                zIndex: 999,
                width: "100%",
                height: "100%"
            });
            $newbox.find('.showTcbox-zhezao').css({
                position: 'absolute',
                width: '100%',
                height: '100%',
                top:0,
                left: 0,
                background: 'black',
                opacity: 0.6,
                "_filter":"alpha(option=60)",
                "filter":"alpha(option=60)"
            });
            $newbox.find('.showTcboxclose').css({
                position: 'absolute',
                top: '6px',
                right: '9px',
                cursor: 'pointer'
            });

            this.newbox = $newbox;
            $newbox.find('.showTcboxclose').click(function(){
                _this.showTcboxClose()
            })
            $newbox.find('.showTcbox-zhezao').click(function(){
                _this.showTcboxClose()
            })
            return $newbox;
        }




